// src/github_data.js
import React from 'react';

// GitHubRepoURL component
function GitHubRepoURL(props) {
  return (
    <p>
      <a
        target="_blank"
        href={props.url}
        rel="noopener noreferrer"
      >
        {props.children || 'GitHub Repo'}
      </a>
    </p>
  );
}

// GitHubAvatar component
function GitHubAvatar(props) {
  const size = props.size || 50; // Default size is 50

  return (
    <img
      src={`https://avatars.githubusercontent.com/u/96261980?v=4&s=${size}`}
      alt="GitHub Avatar"
    />
  );
}

export { GitHubRepoURL, GitHubAvatar };
